import Note from '../components/Note.jsx';


const Notes = props => {
    return (
        <>
            {props.notes ? props.notes.map((noteObject, index) => (
                <Note key={index} noteObject={noteObject} />
            )) : null}
        </>
    );
}

export default Notes
